VALUES ('4604921001366', 'Мягкие вафли с суфле и фруктовой начинкой &quot;Черника&quot;', 'сахар, продукты яичные (меланж), вода, мука пщеничная общего назначения М 55-23, патока, пальмовый олеин (пальмовый олеин рафинированный дезодорированный отбеленный (фракция пальмового масла)), начинка фруктово-ягодная «Черничная» (ягoда черника, сахарный сироп (сахар, вода), декстроза, стабилизатор-пектин, загуститель-камедь рожкового дерева, регулятор кислотности лимонная кислота, консервант сорбат калия, ароматизатор «Черника», краситель «Кармин»), заменитель молочного жира ра финированные дезодорированны частично фракционированные растительные масла: пальмовое, рапсовое, соевое: эмульгатор-моно- и диглицериды жирных кислот, молоко цельное сгущенное с сахаром (молоко нормализованное, сахар (сахароза)), сироп глюкозный (глюкоза, мальтоза, полисахара, фруктоза, влагоудерживающий агент пропиленгликоль, сыворотка сухая молочная, соль, желирующий агент агар, сухой яичный белок, разрыхлитель-гидрокарбонат аммония, ароматизатор «Ваниль», регулятор кислотности - лимонная кислота, эмульгатор- лецитин соевый, влагоудерживающий агент - глицерин, консервант - соpбиновая кислота, ароматизатор «Заварной крем», антиокислитель - аскорбиновая кислота.', 'https://static.openfoodfacts.org/images/products/460/492/100/1366/front_ru.4.400.jpg', '22', '8.5', '52', '29.8', '', '4.5', '', '', '', '0');

