INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('4607004842436', 'Ромео и Джульетта — пломбир в шоколаде', '_сахар - песок_, _крем на растительных маслах_ (вода питьевая, рафинированное, дезодорированное пальмоядровое масло, эмульгатор лецитин, сахар, стабилизаторы (цитрат натрия 3- замещенный, моно- и диглицериды жирных кислот, карбометилцеллюлоза натриевая соль, целлюлоза микрокристаллическая), глюкоза, эмульгатор (полиоксиэтилен (20) сорбитан моностеарат, Твин 60), соль, ароматизатор «Пломбир»), _меланж яичный_, _мука пшеничная хлебопекарная высшего сорта_, _глазурь кондитерская «классика» (сахар, заменитель какао-масла лауринового типа (жир растительный MMR1 - гидрогенизированный, фракционированный, рафинированный, нетемперируемый заменитель какао-масла растительного происхождения нелауринового типа), какао-порошок, эмульгаторы (лецитин соевый, полиглицерина и взаимоэтерифицированных рициноловых кислот эфиры), _какао - порошок_, _начинка молокосодержащая «Гель белый»_ (сахар, сухое обезжиренное молоко, заменитель молочного жира, стабилизатор крахмал, регулятор pH лимонная кислота, краситель диоксид титана, консервант сорбат калия), _эмульгатор для бисквита (паста для сбивания)_ (вода, эмульгаторы (моно-и диглицериды жирных кислот, жирные кислоты, соли алюминия, кальция, натрия, магния, калия и аммония, полиглицерина и жирных кислот эфиры, полиэксиэтилен (20) сорбитан моноолеат), влагоудерживающие агенты (глицерин, пропиленгликоль), патока, консервант (сорбат калия), _ароматизатор, регулятор кислотности - кислота лимонная_, _консервант - кислота сорбиновая_.', 'https://static.openfoodfacts.org/images/products/460/700/484/2436/front_ru.3.400.jpg', '10.5', '', '46.7', '', '', '3.5', '', '', '', '1');

