VALUES ('4607016359021', 'Сырок творожный «Картошка» глазированный', 'творог, кондитерская глазурь (сахар, заменитель масла какао нетемперируемый лауринового типа (фракционированное, гидрогенизированное пальмоядровое масло), какао-порошок, эмульгатор — лецитин соевый, ароматизатор «Ванилин»), сахар-песок, масло сливочное, печенье сахарное (мука пшеничная в/с, масло подсолнечное рафинированное дезодорированное, сироп глюкозно-фруктозный, сахар-песок, патока крахмальная, вода питьевая, разрыхлители: гидрокарбонат натрия, карбонат аммония; соль поваренная пищевая, ароматизатор «Ванилин», консервант: сорбиновая кислота), продукт молочный сгущенный с сахаром (сахар-песок (сахароза), вода питьевая, молоко сухое обезжиренное, масло сливочное), какао-порошок, ароматизатор.', 'https://static.openfoodfacts.org/images/products/460/701/635/9021/front_ru.7.400.jpg', '23', '', '48', '', '', '7', '', '', '', '1');

