INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('4607065001919', 'Dove Promises', 'Молочный шоколад DOVЕО Promises&quot;. Состав: сахар, какао масло, сухое обезжиренное молоко, какао тертое, моЛОЧНЫЙ жир, лактоза, эмульгатор (соевый лецитин), ароматизатор (ванилин). Может содержать незначительное количество яичног белка, глютена, орехов (фундук, миндаль, кешью, фисташка, грецкий, бразильский, кедровый, австралийский, пекан, макадамия). Средние значения пищевой ценности (100 г): белки - 6, 7 г; жиры — 31,81 углеводы - 56,8г. Энергетическая ценность (100 г): 544 ккал /2278 кДж. Молочный шоколад содержит: общий сухой остаток какао молочный остаток-не менее 20%, молочный жир - не менее 4%. Трансизомеров ненасыщенных жирных кислот не менее 2,5%, сухо не более 1 %. XХранить при температуре от +5°С до +22°Сиотносительной влажности возду не более 70 %. Изготовитель: 000 «Одинцовская кондитерская фабрика». Адрес: Россия, 143040, Московская область, Одинцовский район, д. Малые Вяземы, д. 20 (по заказу ООО &quot;Марс&quot;, Россия, 14280 не менее 25 %, сухой обезжиренный остаток какао Московская область, Ступинский район, г. Ступино-1). 21 08.18/1/09', 'https://static.openfoodfacts.org/images/products/460/706/500/1919/front_ru.5.400.jpg', '', '', '', '', '', '', '', '', '', '1');

