VALUES ('4607151981118', 'Витако «Ассорти»', 'сыры полутвердые ???, ??? ферментный препарат микробного происхождения, бактериальный ???, ???чный, вода питьевая, молочный белок (казеин), молоко сухое ???, ???оваренная) ???ля сыра с ветчиной, эмульгаторы (E339, E452), стабилизатор (каррагинан), соль поваренная пищевая, вкусоароматическая добавка «сливочная» (соль мальтодекстрин, сыворотка молочная сухая, глюкоза, натуральные вкусоароматические вещества, сырный порошок, регулятор кислотности лимонная кислота) - для сыра сливочного, вкусоароматическая добавка «Ветчина» (соль, мальтодекстрин, сыворотка молочная сухая, глюкоза, натуральные вкусоароматические вещества, сырный порошок, регулятор кислотности лимонная кислота) - для сыра с ветчиной, консервант сорбат натрия, лактоза', 'https://static.openfoodfacts.org/images/products/460/715/198/1118/front_ru.8.400.jpg', '23.5', '', '5.6', '', '', '11.5', '', '', '', '1');

