VALUES ('4607151981958', 'Плавленый сыр чеддер', 'сыры полутвердые (молоко пастеризованное, соль поваренная, уплотнитель-хлорид кальция, ферментный препарат микробного происхождения, бактериальный концентрат молочнокислых бактерий), масло сливочное, жир молочный, вода питьевая, молочный белок (казеин), молоко сухое обезжиренное, сыворотка сухая молочная, соли-плавители (E339, E452), соль поваренная пищевая, вкусоароматическая добавка «Чеддер» (соль, мальтодекстрин, сыворотка молочная сухая, глюкоза, натуральные вкусоароматические вещества, сырный порошок, регулятор кислотности лимонная кислота), консервант сорбат натрия, пищевой краситель Аннато. Содержит лактозу.', 'https://static.openfoodfacts.org/images/products/460/715/198/1958/front_ru.5.400.jpg', '22.5', '', '5.6', '', '', '16', '', '', '', '1');

