INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('4620001313426', 'Напиток безалкогольный среднегазированный Ред грасс', 'вода очищенная, сахар, концентрированный яблочный сок, ароматизаторы (натуральные вкусоароматческие вещества, растительные экстракты: можжевельник, тимьян, шиповник); регулятор кислотности кислота лимонная,; концентрированный морковный сок; краситель сахарный колер 4 (карамельный); растительные экстракты мелиссы, ромашки, цветков липы.', 'https://static.openfoodfacts.org/images/products/462/000/131/3426/front_ru.11.400.jpg', '', '', '10', '', '', '', '', '', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('4620001317806', 'Red Devil', 'Вода очищенная; глюкозно-фруктозный сироп и сахар или сахар; регуляторы кислотности: кислота лимонная и цитрат натрия; ароматизатор (натуральные вкусоaроматические вещества); таурин; кофеин натуральный; консервант бензоат натрия; красители: Е129 (аллюра красный), желтый, хинолиновый; витаминная смесь (витамины: С, В1, B3, B6, B9, B12).', 'https://static.openfoodfacts.org/images/products/462/000/131/7806/front_ru.4.400.jpg', '', '', '16', '', '', '', '', '', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('4620001320950', 'Tiramisu restorante', 'сыр-крем «Маскарпоне» (сливки 25% жирности, винная кислота, белый винный уксус), сахар-песок, яйца куриные, мука пшеничная в/с, сливки 33% жирности (сливки УВТ обработанные, кофе растворимый, какао-порошок, желатин пищевой, ликер «Амаретто Дисаронно», консервант сорбиновая кислота, пищевая добавка вкусоароматическая «ВАНИЛЛАР 1410051» (глюкоза, ванилин).', 'https://static.openfoodfacts.org/images/products/462/000/132/0950/front_ru.5.400.jpg', '12.5', '', '27', '', '', '6.7', '', '', '', '1');

