VALUES ('4620001321025', 'Торт «Птичье молоко от Фили-Бейкер»', 'сахар-песок, продукт молокосодержащий сгущенный с сахаром и растительным жиром (молоко цельное, молоко сухое обезжиренное, сахар, заменитель молочного жира), спред растительно-сливочный (растительно-сливочное, молоко сухое обезжиренное), яйца куриные, кондитерская глазурь (сахар-песок, молочный шоколад, заменитель какао масла, какао-порошок), полуфабрикат для приготовления бисквитов (кукурузный крахмал, обезжиренное сухое молоко, соль, ароматизатор), мука пшеничная в/с, загуститель агар-агар, уксус столовый, масло растительное, пищевая добавка вкусоароматическая &quot;Ваниллар 1410051&quot; (глюкоза, ванилин), консервант сорбиновая кислота.', 'https://static.openfoodfacts.org/images/products/462/000/132/1025/front_ru.13.400.jpg', '14.4', '', '36.3', '', '', '9.2', '', '', '', '1');

