INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('4670018652742', 'Конфеты помадные &quot;К чаю&quot;', 'Конфеты помадные, глазированные глазурью: сахар; патока крахмальная; сыворотка молочная сухая; жир кондитерский (рафинированные дезодорированные растительные масла: пальмовое, подсолнечное, антиокислители: аскорбиновая кислота, альфа-токоферол); ароматизаторы: «Пломбир», ванилин; стабилизатор агар; глазурь (сахар, заменитель масла какао (рафинированные дезодорированные растительные масла: подсолнечное, пальмовое, эмульгаторы E492, E322, антиокислитель E306), какао-порошок, эмульгаторы: E476, соевый лецитин, комплексная пищевая добавка - антиокислитель (эмульгатор E432, антиокислители: E300, E307, средняя цепь триглицеридов, ароматизатор ванилин). Конфеты помадные, глазированные глазурью: сахар; сыворотка молочная сухая; патока крахмальная; жир кондитерский (рафинированные дезодорированные растительные масла: пальмовое, подсолнечное, антиокислители: аскорбиновая кислота, альфа-токоферол); заменитель молочного жира (рафинированные дезодорированные растительные масла: пальмовое и его фракции, подсолнечное, пальмоядровое и его фракции, антиокислитель: токоферолы, концентрат смеси); какао-порошок; спирт этиловый высшей очистки; ароматизаторы «Пломбир», ванилин; стабилизатор агар: глазурь (сахар, заменитель масла какао (рафинированные дезодорированные растительные масла: подсолнечное, пальмовое, эмульгаторы E492, E322, антиокислитель E306, какао-порошок, эмульгаторы: E476, соевый лецитин, комплексная пищевая добавка - антиокислитель (эмульгатор E432, антиокислители. E300, E307, средняя цепь триглицеридов, ароматизатор ванилин).', 'https://static.openfoodfacts.org/images/products/467/001/865/2742/front_ru.4.400.jpg', '13', '', '80', '', '', '2', '', '', '', '1');

