VALUES ('4690363011070', 'Шоколадный торт с пралине (вафельный)', 'вода питьевая, мука пшеничная хлебопекарная высшего сорта, жир кондитерский (рафинированные дезодорированные растительные масла (подсолнечное, пальмовое) в натуральном и отвержденном виде), кондитерская масса типа пралине (сахар, _арахис_ жареный тертый, кондитерский жир, какао-порошок, эмульгатор — соевый лецитин, ароматизатор). кондитерская глазурь (сахар, заменители масла какао нелауринового типа, какао-порошок, эмульгаторы (_соевый лецитин_, E476), ароматизатор), крахмал картофельный, масло кокосовое, соль, _продукты яичные_, пралине, шоколад, разрыхлители — гидрокарбонат натрия, карбонат аммония, эмульгатор - лецитин соевый, регулятор кислотности - кислота лимонная Противопоказано при индивидуальной непереносимости _соевого лецитина_, _продуктов яичных_, _орехов_, _арахиса_.', 'https://static.openfoodfacts.org/images/products/469/036/301/1070/front_ru.11.400.jpg', '40', '', '48', '', '', '6', '', '', '', '0');

