VALUES ('4690363036615', 'Слойка с малиной', 'мука пшеничная хлебопекарная высшего сорта, малина, сахар-песок, вода питьевая, маргарин (рафинированные дезодорированные растительные масла в натуральном и отвержденном виде, вода, эмульгатор: E471, E475, E322; соль поваренная пищевая, консервант сорбат калия; ароматизатор идентичный натуральному «Сливки», регулятор кислотности лимонная кислота; краситель аннато-куркумин), комплексная пищевая добавка (загустители: E1412, E412, E401, сахар, стабилизатор: E331iii), дрожжи хлебопекарные, яйца куриные, молоко сухое цельное, соль поваренная пищевая, яичный порошок, улучшитель теста «Мажимикс» (пшеничная мука, стабилизатор — карбонад кальция, эмульгатор E472e, антиокислитель — аскорбиновая кислота, технологические вспомогательные средства — ферменты (амилазы и гемицеллюлазы).', 'https://static.openfoodfacts.org/images/products/469/036/303/6615/front_ru.5.400.jpg', '6.6', '', '54', '', '', '4.7', '', '', '', '1');

