VALUES ('4750001944877', 'Rīts', 'Sokolädes konfektes Rits. Sokolâde 27%. Sastāvdalas: cukurs, zemesrieksti, dale hidrogenëti augu tauki (palmu ella, basijas ella, emulgatori (sorbitana tristearáts, sojas lecitini)), kakao masa, kakao sviests, emulgatori (amonija fosfatidi, sojas lecitini, poliglicerina poliricinoläts, sorbitana tristearats), aromatizėtājs. Var saturët piena, kviešu lipekla, olu, riekstu dalinas. Kakao saturs šokolãdě vismaz 39%. Uzglabat sausa un vesa vieta (18±3)° C. EN Chocolate sweets Rits. Chocolate 27%. Ingredients: sugar, peanuts, partly hydrogenated vegetable oil (palm oil, shea oil, emulsifiers (sorbitan tristearate, soya lecithins)), cocoa mass, cocoa butter, emulsifiers (ammonium phosphatides, soya lecithins, polyglycerol polyricinoleate, sorbitan tristearate), flavouring. May contain traces of milk, wheat gluten, eggs and nuts. Cocoa solids in chocolate 39% minimum.Store in a cool and dry place (18 +3) °C Sokoladiniai saldainiai &quot;Rits&quot;. Šokolado - 27%. Sudedamosios dalys: cukrus, žemės LT riešutai, iš dalies hidrinti augaliniai riebalai (palmių aliejus, sviestmedžių aliejus, emulsikliai (sorbitano tristearatas, sojų lecitinas), kakavos masė, kakavos sviestas, emulsikliai (amonio fosfolipidai, sojų lecitinas, poliglicerolio poliricinoleatas, sorbitano tristearatas), kvapioji medžiaga. Gali būti pieno, kviedų glitimo, kiaušinių, riešuty pėdsakų. Kakavos sausujų medžiagų-ne mažiau kaip 39%. Laikyti vèsioje ir sausoje vietoje (18t3)° C. Halvaamaitseline pralineekompvekid Rits. Sokolaadi 27%. Koostisosad: suhkur, emulgaatorid EST maapähklid, osaliselt hüdrogeenitud taimsed rasvad (palmiöli, võiseemnikuöli, emulgaatorid (sorbitaantristearaat, sojaletsitiin)), kakaomass, kakaovõi, (ammooniumfosfatidid, sojaletsitiin, polüglütseroolpolüritsinoleaat, sorbitaantristearaat), lõhna - ja maitseaine. Võib sisaldada piima, nisuvalgu, muna, pähklite osakesi. Sokolaadialasuuris kakao sisaldus vähemalt 39%. Säilitada jahedas ja kuivas kohas (18+3)° C. Turustaja Eestis: AS Kalev, Põrguvälja tee 6, Lehmja, Rae vald, 75306, Harjumaa, Eesti. Шоколадные kонфеты Ритс. Шоколад 27%. Состав: сахар, арахис, частично PIUS гидрогенизированный растительный жир (пальмовое масло, масло ши, эмульгаторы (coрбитан тристеарат, соевые лецитины)), какао тертое, какао масло, эмульгаторы ( фосфатиды соевые лецитины, эфиры полиглицерина и аммония, взаимоэтерифицированных рицИноловых кислот, сорбитан тристеарат), ароматизатор. Возможно содержание частиЦ молока, пшеничной клейковины, яиц, орехов. Ощий сухой остаток какао в шоколаде не менее 39%. Средние значения пищевой Цениости в 100г продукта: энергетическая ценность 2100 кДж /500 ккал, белки-6 г, жиры - 26г, углеводы - 61 г. 1 порция 40 г продукта содержит: энергетическая ценность - ЗАО кДж /200ккал (8%**), белки - 2,5г (3%**), жиры—10г (12%**), углеводы - 24 г 14 ** Pекомендуемый уровень суточного ПОТтребления (10467 кДж / 2500ккал) - ласно ТР ТС 022/2011. Хранить в прохладном и сухом месте (18+3)° C. Импортер и Санит - Петербург, 5-я линия, 70, Васильевский о-в.Тел. (812)323-04-16. 000 «Синистра», УМОЛноМоченный преЛставитель на территории РФ: 000 «СОЛО» 199178, 000 «Примар» Россия 236001, г. Калининград, ул. Ялтинская 44, тел. 8(4012) 57-55-77. Dz bal oal vale Maistingumas Toitumisalane teave/ Пищевая ценность Uz/per/ 100 g/r Uz pordju/ per portion/ pordjoje/ portsjonis/ Bпорции 40 g/r (3 gab/pcs/vnt/tk/ur) ID*uz porciju per portion/ Hal nergetiská vertiba/ Energy/ pordijoje/portsjonis/ ergetine verte/ Energiasisaldus/ ntRTV020 В порции 40 qfr', 'https://static.openfoodfacts.org/images/products/475/000/194/4877/front_en.3.400.jpg', '25', '10', '60', '60', '0', '5', '0.05', '0.0197', '0', '0');

